// SPDX-License-Identifier: MIT
pragma solidity =0.6.12;

import '@openzeppelin/contracts/token/ERC20/SafeERC20.sol';
import './libraries/GoSwapLibrary.sol';
import './libraries/TransferHelper.sol';
import './interfaces/IGoSwapRouter.sol';
import './interfaces/IERC20GoSwap.sol';
import './interfaces/IWHT.sol';

/**
 * @title GoSwap 
 */
contract GoSwapRouter is IGoSwapRouter {
    using SafeMath for uint256;

    /// @notice pairForWHT
    address public immutable override company;
    address public immutable override WHT;

    /**
     * @dev :
     */
    modifier ensure(uint256 deadline) {
        require(deadline >= block.timestamp, 'GoSwapRouter: EXPIRED');
        _;
    }

    /**
     * @dev ,
     */
    function factory() public view override returns (address) {
        return IGoSwapCompany(company).factory();
    }

    /**
     * @dev 
     * @param _company 
     * @param _WHT WHT 
     */
    constructor(address _company, address _WHT) public {
        company = _company;
        WHT = _WHT;
    }

    /**
     * @dev 
     */
    receive() external payable {
        //WHT
        assert(msg.sender == WHT); // only accept HT via fallback from the WHT contract
    }

    // ****  ****
    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param amountADesired A
     * @param amountBDesired B
     * @param amountAMin A
     * @param amountBMin B
     * @return amountA   A
     * @return amountB   B
     */
    function _addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin
    ) internal virtual returns (uint256 amountA, uint256 amountB) {
        // 
        address pairFactory = IGoSwapCompany(company).pairForFactory(tokenA, tokenB);
        //,
        if (pairFactory == address(0)) {
            IGoSwapCompany(company).createPair(tokenA, tokenB);
        }
        //reserve{A,B}
        (uint256 reserveA, uint256 reserveB, ) = GoSwapLibrary.getReservesWithoutDummy(company, tokenA, tokenB);
        //reserve{A,B}==0
        if (reserveA == 0 && reserveB == 0) {
            //amount{A,B} = A,B
            (amountA, amountB) = (amountADesired, amountBDesired);
        } else {
            //B = A * B / A
            uint256 amountBOptimal = GoSwapLibrary.quote(amountADesired, reserveA, reserveB);
            //B <= B
            if (amountBOptimal <= amountBDesired) {
                //B >= B
                require(amountBOptimal >= amountBMin, 'GoSwapRouter: INSUFFICIENT_B_AMOUNT');
                //amount{A,B} = A, B
                (amountA, amountB) = (amountADesired, amountBOptimal);
            } else {
                //A = A * A / B
                uint256 amountAOptimal = GoSwapLibrary.quote(amountBDesired, reserveB, reserveA);
                //A <= A
                assert(amountAOptimal <= amountADesired);
                //A >= A
                require(amountAOptimal >= amountAMin, 'GoSwapRouter: INSUFFICIENT_A_AMOUNT');
                //amount{A,B} = A, B
                (amountA, amountB) = (amountAOptimal, amountBDesired);
            }
        }
    }

    /**
     * @dev *
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param amountADesired A
     * @param amountBDesired B
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @return amountA   A
     * @return amountB   B
     * @return liquidity   
     */
    function addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    )
        external
        virtual
        override
        ensure(deadline)
        returns (
            uint256 amountA,
            uint256 amountB,
            uint256 liquidity
        )
    {
        //,A,B
        (amountA, amountB) = _addLiquidity(tokenA, tokenB, amountADesired, amountBDesired, amountAMin, amountBMin);
        //TokenA,TokenB,`pair`
        address pair = GoSwapLibrary.pairFor(company, tokenA, tokenB);
        //amountAtokenAmsg.senderpair
        TransferHelper.safeTransferFrom(tokenA, msg.sender, pair, amountA);
        //amountBtokenBmsg.senderpair
        TransferHelper.safeTransferFrom(tokenB, msg.sender, pair, amountB);
        // = pairto
        liquidity = IGoSwapPair(pair).mint(to);
    }

    /**
     * @dev HT*
     * @param token token
     * @param amountTokenDesired Token
     * @param amountTokenMin Token
     * @param amountHTMin HT
     * @param to to
     * @param deadline 
     * @return amountToken   Token
     * @return amountHT   ETH
     * @return liquidity   
     */
    function addLiquidityHT(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountHTMin,
        address to,
        uint256 deadline
    )
        external
        payable
        virtual
        override
        ensure(deadline)
        returns (
            uint256 amountToken,
            uint256 amountHT,
            uint256 liquidity
        )
    {
        //,Token,HT
        (amountToken, amountHT) = _addLiquidity(token, WHT, amountTokenDesired, msg.value, amountTokenMin, amountHTMin);
        //Token,WHT,`pair`
        address pair = GoSwapLibrary.pairFor(company, token, WHT);
        //`Token`tokenmsg.sender`pair`
        TransferHelper.safeTransferFrom(token, msg.sender, pair, amountToken);
        //`HT``HT`
        IWHT(WHT).deposit{value: amountHT}();
        //`HT``HT`token`pair`
        assert(IWHT(WHT).transfer(pair, amountHT));
        // = pair`to`
        liquidity = IGoSwapPair(pair).mint(to);
        //``>`HT` ``-`HT`
        if (msg.value > amountHT) TransferHelper.safeTransferHT(msg.sender, msg.value - amountHT);
    }

    // ****  ****
    /**
     * @dev *
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param liquidity 
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @return amountA   A
     * @return amountB   B
     */
    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint256 liquidity,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    ) public virtual override ensure(deadline) returns (uint256 amountA, uint256 amountB) {
        //TokenA,TokenBCREATE2
        address pair = GoSwapLibrary.pairFor(company, tokenA, tokenB);
        //pair()
        IERC20GoSwap(pair).transferFrom(msg.sender, pair, liquidity); // send liquidity to pair
        //pair,0,1tokento
        (uint256 amount0, uint256 amount1) = IGoSwapPair(pair).burn(to);
        //tokenA,tokenB
        (address token0, ) = GoSwapLibrary.sortTokens(tokenA, tokenB);
        //tokenAB
        (amountA, amountB) = tokenA == token0 ? (amount0, amount1) : (amount1, amount0);
        //ABAB
        require(amountA >= amountAMin, 'GoSwapRouter: INSUFFICIENT_A_AMOUNT');
        require(amountB >= amountBMin, 'GoSwapRouter: INSUFFICIENT_B_AMOUNT');
    }

    /**
     * @dev HT*
     * @param token token
     * @param liquidity 
     * @param amountTokenMin token
     * @param amountHTMin HT
     * @param to to
     * @param deadline 
     * @return amountToken   token
     * @return amountHT   HT
     */
    function removeLiquidityHT(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountHTMin,
        address to,
        uint256 deadline
    ) public virtual override ensure(deadline) returns (uint256 amountToken, uint256 amountHT) {
        //(token,HT) = (token,WHT,,token,HT,,)
        (amountToken, amountHT) = removeLiquidity(
            token,
            WHT,
            liquidity,
            amountTokenMin,
            amountHTMin,
            address(this),
            deadline
        );
        //tokentokento
        TransferHelper.safeTransfer(token, to, amountToken);
        //WHTHT
        IWHT(WHT).withdraw(amountHT);
        //HTHTto
        TransferHelper.safeTransferHT(to, amountHT);
    }

    /**
     * @dev *
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param liquidity 
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @param approveMax 
     * @param v v
     * @param r r
     * @param s s
     * @return amountA   A
     * @return amountB   B
     */
    function removeLiquidityWithPermit(
        address tokenA,
        address tokenB,
        uint256 liquidity,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external virtual override returns (uint256 amountA, uint256 amountB) {
        //TokenA,TokenBCREATE2
        address pair = GoSwapLibrary.pairFor(company, tokenA, tokenB);
        //,valueuint256,
        uint256 value = approveMax ? uint256(-1) : liquidity;
        //pair(,,,,v,r,s)
        IERC20GoSwap(pair).permit(msg.sender, address(this), value, deadline, v, r, s);
        //(A,B) = (tokenA,tokenB,,A,B,to,)
        (amountA, amountB) = removeLiquidity(tokenA, tokenB, liquidity, amountAMin, amountBMin, to, deadline);
    }

    /**
     * @dev HT*
     * @param token token
     * @param liquidity 
     * @param amountTokenMin token
     * @param amountHTMin HT
     * @param to to
     * @param deadline 
     * @param approveMax 
     * @param v v
     * @param r r
     * @param s s
     * @return amountToken   token
     * @return amountHT   HT
     */
    function removeLiquidityHTWithPermit(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountHTMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external virtual override returns (uint256 amountToken, uint256 amountHT) {
        //Token,WETHCREATE2
        address pair = GoSwapLibrary.pairFor(company, token, WHT);
        //,valueuint256,
        uint256 value = approveMax ? uint256(-1) : liquidity;
        //pair(,,,,v,r,s)
        IERC20GoSwap(pair).permit(msg.sender, address(this), value, deadline, v, r, s);
        //(token,HT) = HT(token,,token,HT,to,)
        (amountToken, amountHT) = removeLiquidityHT(token, liquidity, amountTokenMin, amountHTMin, to, deadline);
    }

    /**
     * @dev Token*
     * @param token token
     * @param liquidity 
     * @param amountTokenMin token
     * @param amountHTMin HT
     * @param to to
     * @param deadline 
     * @return amountHT   HT
     */
    function removeLiquidityHTSupportingFeeOnTransferTokens(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountHTMin,
        address to,
        uint256 deadline
    ) public virtual override ensure(deadline) returns (uint256 amountHT) {
        //(,HT) = (token,WHT,,token,HT,,)
        (, amountHT) = removeLiquidity(token, WHT, liquidity, amountTokenMin, amountHTMin, address(this), deadline);
        //tokentokento
        TransferHelper.safeTransfer(token, to, IERC20GoSwap(token).balanceOf(address(this)));
        //WHTHT
        IWHT(WHT).withdraw(amountHT);
        //HTHTto
        TransferHelper.safeTransferHT(to, amountHT);
    }

    /**
     * @dev ,Token*
     * @param token token
     * @param liquidity 
     * @param liquidity 
     * @param amountTokenMin token
     * @param amountHTMin HT
     * @param to to
     * @param deadline 
     * @param approveMax 
     * @param v v
     * @param r r
     * @param s s
     * @return amountHT   HT
     */
    function removeLiquidityHTWithPermitSupportingFeeOnTransferTokens(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountHTMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external virtual override returns (uint256 amountHT) {
        //Token,WHTCREATE2
        address pair = GoSwapLibrary.pairFor(company, token, WHT);
        //,valueuint256,
        uint256 value = approveMax ? uint256(-1) : liquidity;
        //pair(,,,,v,r,s)
        IERC20GoSwap(pair).permit(msg.sender, address(this), value, deadline, v, r, s);
        //(,HT) = Token(token,,Token,HT,to,)
        amountHT = removeLiquidityHTSupportingFeeOnTransferTokens(
            token,
            liquidity,
            amountTokenMin,
            amountHTMin,
            to,
            deadline
        );
    }

    // ****  ****
    /**
     * @dev *
     * @notice 
     * @param amounts 
     * @param path 
     * @param _to to
     */
    function _swap(
        uint256[] memory amounts,
        address[] memory path,
        address _to
    ) internal virtual {
        //
        for (uint256 i; i < path.length - 1; i++) {
            //(,) = (,)
            (address input, address output) = (path[i], path[i + 1]);
            //token0 = (,)
            (address token0, ) = GoSwapLibrary.sortTokens(input, output);
            // = 
            uint256 amountOut = amounts[i + 1];
            //(0,1) = ==token0 ? (0,) : (,0)
            (uint256 amount0Out, uint256 amount1Out) =
                input == token0 ? (uint256(0), amountOut) : (amountOut, uint256(0));
            //to = i<-2 ? (,)pair : to
            address to = i < path.length - 2 ? GoSwapLibrary.pairFor(company, output, path[i + 2]) : _to;
            //(,)pair(0,1,to,0x00)
            IGoSwapPair(GoSwapLibrary.pairFor(company, input, output)).swap(
                amount0Out,
                amount1Out,
                to,
                new bytes(0)
            );
        }
    }

    /**
     * @dev tokentoken*
     * @param amountIn 
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts  
     */
    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external virtual override ensure(deadline) returns (uint256[] memory amounts) {
        //  (
        //      ( * (1000-fee) * Out) /
        //      (In * 1000 +  * (1000-fee)))
        amounts = GoSwapLibrary.getAmountsOut(company, amountIn, path);
        //>=
        require(amounts[amounts.length - 1] >= amountOutMin, 'GoSwapRouter: INSUFFICIENT_OUTPUT_AMOUNT');
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            GoSwapLibrary.pairFor(company, path[0], path[1]),
            amounts[0]
        );
        //(,,to)
        _swap(amounts, path, to);
    }

    /**
     * @dev tokentoken*
     * @param amountOut 
     * @param amountInMax 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts  
     */
    function swapTokensForExactTokens(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external virtual override ensure(deadline) returns (uint256[] memory amounts) {
        //  (
        //      (In * Out * 1000) /
        //      (Out -  * (1000-fee)) + 1)
        amounts = GoSwapLibrary.getAmountsIn(company, amountOut, path);
        //<=
        require(amounts[0] <= amountInMax, 'GoSwapRouter: EXCESSIVE_INPUT_AMOUNT');
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            GoSwapLibrary.pairFor(company, path[0], path[1]),
            amounts[0]
        );
        //(,,to)
        _swap(amounts, path, to);
    }

    /**
     * @dev ETHtoken*
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts  
     */
    function swapExactHTForTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable virtual override ensure(deadline) returns (uint256[] memory amounts) {
        //WHT
        require(path[0] == WHT, 'GoSwapRouter: INVALID_PATH');
        //  (
        //      (msg.value * (1000-fee) * Out) /
        //      (In * 1000 + msg.value * (1000-fee)))
        amounts = GoSwapLibrary.getAmountsOut(company, msg.value, path);
        //>=
        require(amounts[amounts.length - 1] >= amountOutMin, 'GoSwapRouter: INSUFFICIENT_OUTPUT_AMOUNT');
        //[0]HTHT
        IWHT(WHT).deposit{value: amounts[0]}();
        //[0]HT(0,1)pair
        assert(IWHT(WHT).transfer(GoSwapLibrary.pairFor(company, path[0], path[1]), amounts[0]));
        //(,,to)
        _swap(amounts, path, to);
    }

    /**
     * @dev tokenHT*
     * @param amountOut 
     * @param amountInMax 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts  
     */
    function swapTokensForExactHT(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external virtual override ensure(deadline) returns (uint256[] memory amounts) {
        //WHT
        require(path[path.length - 1] == WHT, 'GoSwapRouter: INVALID_PATH');
        //  (
        //      (In * Out * 1000) /
        //      (Out -  * (1000-fee)) + 1)
        amounts = GoSwapLibrary.getAmountsIn(company, amountOut, path);
        //<=
        require(amounts[0] <= amountInMax, 'GoSwapRouter: EXCESSIVE_INPUT_AMOUNT');
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            GoSwapLibrary.pairFor(company, path[0], path[1]),
            amounts[0]
        );
        //(,,)
        _swap(amounts, path, address(this));
        //HTHT
        IWHT(WHT).withdraw(amounts[amounts.length - 1]);
        //ETHto
        TransferHelper.safeTransferHT(to, amounts[amounts.length - 1]);
    }

    /**
     * @dev tokenHT*
     * @param amountIn 
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts  
     */
    function swapExactTokensForHT(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external virtual override ensure(deadline) returns (uint256[] memory amounts) {
        //WHT
        require(path[path.length - 1] == WHT, 'GoSwapRouter: INVALID_PATH');
        //  (
        //      ( * (1000-fee) * Out) /
        //      (In * 1000 +  * (1000-fee))))
        amounts = GoSwapLibrary.getAmountsOut(company, amountIn, path);
        //>=
        require(amounts[amounts.length - 1] >= amountOutMin, 'GoSwapRouter: INSUFFICIENT_OUTPUT_AMOUNT');
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            GoSwapLibrary.pairFor(company, path[0], path[1]),
            amounts[0]
        );
        //(,,)
        _swap(amounts, path, address(this));
        //WHTHT
        IWHT(WHT).withdraw(amounts[amounts.length - 1]);
        //HTto
        TransferHelper.safeTransferHT(to, amounts[amounts.length - 1]);
    }

    /**
     * @dev HTtoken*
     * @param amountOut 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts  
     */
    function swapHTForExactTokens(
        uint256 amountOut,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable virtual override ensure(deadline) returns (uint256[] memory amounts) {
        //WHT
        require(path[0] == WHT, 'GoSwapRouter: INVALID_PATH');
        //  (
        //      (In * Out * 1000) /
        //      (Out -  * (1000-fee)) + 1)
        amounts = GoSwapLibrary.getAmountsIn(company, amountOut, path);
        //<=msg.value
        require(amounts[0] <= msg.value, 'GoSwapRouter: EXCESSIVE_INPUT_AMOUNT');
        //[0]ETHWHT
        IWHT(WHT).deposit{value: amounts[0]}();
        //[0]WHT(0,1)pair
        assert(IWHT(WHT).transfer(GoSwapLibrary.pairFor(company, path[0], path[1]), amounts[0]));
        //(,,to)
        _swap(amounts, path, to);
        //``>`[0]` ``-`[0]`
        if (msg.value > amounts[0]) TransferHelper.safeTransferHT(msg.sender, msg.value - amounts[0]);
    }

    // ****  (Token) ****
    // requires the initial amount to have already been sent to the first pair
    /**
     * @dev Token*
     * @param path 
     * @param _to to
     */
    function _swapSupportingFeeOnTransferTokens(address[] memory path, address _to) internal virtual {
        //
        for (uint256 i; i < path.length - 1; i++) {
            //(,) = (,)
            (address input, address output) = (path[i], path[i + 1]);
            // ,
            IGoSwapPair pair = IGoSwapPair(GoSwapLibrary.pairFor(company, input, output));
            //token0 = (,)
            (address token0, ) = GoSwapLibrary.sortTokens(input, output);
            // 
            uint256 amountInput;
            uint256 amountOutput;
            {
                //
                //
                uint8 fee = pair.fee();
                //0,1
                (uint256 reserve0, uint256 reserve1, ) = pair.getReserves();
                // 
                (uint256 reserveInput, uint256 reserveOutput) =
                    input == token0 ? (reserve0, reserve1) : (reserve1, reserve0);
                // 0,1,-
                amountInput = input == token0
                    ? pair.balanceOfIndex(0).sub(reserve0)
                    : pair.balanceOfIndex(1).sub(reserve1);
                //,,,
                amountOutput = GoSwapLibrary.getAmountOut(amountInput, reserveInput, reserveOutput, fee);
            }
            // // 0,1
            (uint256 amount0Out, uint256 amount1Out) =
                input == token0 ? (uint256(0), amountOutput) : (amountOutput, uint256(0));
            //to = i<-2 ? (,)pair : to
            address to = i < path.length - 2 ? GoSwapLibrary.pairFor(company, output, path[i + 2]) : _to;
            //pair(0,1,to,0x00)
            pair.swap(amount0Out, amount1Out, to, new bytes(0));
        }
    }

    /**
     * @dev tokentoken,Token*
     * @param amountIn 
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     */
    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external virtual override ensure(deadline) {
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            GoSwapLibrary.pairFor(company, path[0], path[1]),
            amountIn
        );
        // totoken
        uint256 balanceBefore = IERC20GoSwap(path[path.length - 1]).balanceOf(to);
        // Token
        _swapSupportingFeeOnTransferTokens(path, to);
        // totoken
        require(
            IERC20GoSwap(path[path.length - 1]).balanceOf(to).sub(balanceBefore) >= amountOutMin,
            'GoSwapRouter: INSUFFICIENT_OUTPUT_AMOUNT'
        );
    }

    /**
     * @dev ETHtoken,Token*
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     */
    function swapExactHTForTokensSupportingFeeOnTransferTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable virtual override ensure(deadline) {
        //WHT
        require(path[0] == WHT, 'GoSwapRouter: INVALID_PATH');
        //=
        uint256 amountIn = msg.value;
        //WHTHT
        IWHT(WHT).deposit{value: amountIn}();
        //WHT0,1
        assert(IWHT(WHT).transfer(GoSwapLibrary.pairFor(company, path[0], path[1]), amountIn));
        // totoken
        uint256 balanceBefore = IERC20GoSwap(path[path.length - 1]).balanceOf(to);
        // Token
        _swapSupportingFeeOnTransferTokens(path, to);
        // totoken
        require(
            IERC20GoSwap(path[path.length - 1]).balanceOf(to).sub(balanceBefore) >= amountOutMin,
            'GoSwapRouter: INSUFFICIENT_OUTPUT_AMOUNT'
        );
    }

    /**
     * @dev tokenHT,Token*
     * @param amountIn 
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     */
    function swapExactTokensForHTSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external virtual override ensure(deadline) {
        //WHT
        require(path[path.length - 1] == WHT, 'GoSwapRouter: INVALID_PATH');
        //0Token0,1
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            GoSwapLibrary.pairFor(company, path[0], path[1]),
            amountIn
        );
        //Token
        _swapSupportingFeeOnTransferTokens(path, address(this));
        //=WHT
        uint256 amountOut = IERC20GoSwap(WHT).balanceOf(address(this));
        //
        require(amountOut >= amountOutMin, 'GoSwapRouter: INSUFFICIENT_OUTPUT_AMOUNT');
        //WHT
        IWHT(WHT).withdraw(amountOut);
        //HTto
        TransferHelper.safeTransferHT(to, amountOut);
    }

    // **** LIBRARY FUNCTIONS ****
    function quote(
        uint256 amountA,
        uint256 reserveA,
        uint256 reserveB
    ) public pure virtual override returns (uint256 amountB) {
        return GoSwapLibrary.quote(amountA, reserveA, reserveB);
    }

    function getAmountOut(
        uint256 amountIn,
        uint256 reserveIn,
        uint256 reserveOut,
        uint8 fee
    ) public pure virtual override returns (uint256 amountOut) {
        return GoSwapLibrary.getAmountOut(amountIn, reserveIn, reserveOut, fee);
    }

    function getAmountIn(
        uint256 amountOut,
        uint256 reserveIn,
        uint256 reserveOut,
        uint8 fee
    ) public pure virtual override returns (uint256 amountIn) {
        return GoSwapLibrary.getAmountIn(amountOut, reserveIn, reserveOut, fee);
    }

    function getAmountsOut(uint256 amountIn, address[] memory path)
        public
        view
        virtual
        override
        returns (uint256[] memory amounts)
    {
        return GoSwapLibrary.getAmountsOut(company, amountIn, path);
    }

    function getAmountsIn(uint256 amountOut, address[] memory path)
        public
        view
        virtual
        override
        returns (uint256[] memory amounts)
    {
        return GoSwapLibrary.getAmountsIn(company, amountOut, path);
    }
}

